import React from 'react';

const VideoSection = () => {
  return (
    <div className="video-section bg-[#072F57] w-[1316px] h-[623px] m-auto p-">
    <section className="container mx-auto my-8 text-center">
      <h3 className="text-xl font-bold mb-4">Post Your Requirements</h3>
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/dQw4w9WgXcQ"
        title="YouTube video"
        className="mx-auto"
        allowFullScreen
      ></iframe>
    </section>
    </div>
  );
};

export default VideoSection;
